import './App.css';
import Button from 'react-bootstrap/Button';
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <h1>KickBuddy</h1>
      <div className="grid-container">
        <Button className="grid-item">This is a button</Button>
        <Button classNme="grid-item">2This is a button</Button>
        <Button classNme="grid-item">3This is a button</Button>
        <Button classNme="grid-item">4This is a button</Button>
      </div>

    </div>
  );
}

export default App;
